<!-- This is the first visualization -->
<div class="iframe-container-one">
  <iframe title="Heat-related deaths in Maryland and Baltimore" aria-label="Grouped Bars" id="datawrapper-chart-etQEX" src="https://datawrapper.dwcdn.net/etQEX/1/" scroll="no" border="0" style="width: 0; min-width: 100% !important; border: none;" height="528" data-external="1">
  </iframe>
  <script type="text/javascript">window.addEventListener("message",function(a){if(void 0!==a.data["datawrapper-height"]){var e=document.querySelectorAll("iframe");for(var t in a.data["datawrapper-height"])for(var r,i=0;r=e[i];i++)if(r.contentWindow===a.source){var d=a.data["datawrapper-height"][t]+"px";r.style.height=d}}});
  </script>
</div>
